import React from 'react'
import '../styles/App.css'

function Slot(props) {
  return (
    <div className='Slot' style={{ flexDirection:  props.reverse }}>
        <div className='slot-icon' onClick={() => props.setModal(props.name)}></div>
        <div className='slot-info'>{ props.name }</div>
    </div>
  )
}

export default Slot
